//Instalamos dependencias axios (peticiones al backend) y react-router-dom
//Instalamos bootstrap y agregamos icons del fontawesome con el cdnjs al index.html de la carpeta public
//Aqui manejamos el mostrar todas las canchas y eliminar una cancha
import axios from 'axios'
//Loss hooks useState y useEffect son para que los componentes puedan utilizar todas las caracteristicas de React
//useState retorna un valor con estado y una funcion a actualizar.
//useEffect hace referencia a algo que react no controla y lo deja ejecutarse per se
//en este caso el efecto getCanchas se va a manejar por los mecanismos que se crearon en el backend
import {useState, useEffect} from 'react'
import { Link } from 'react-router-dom';

//Referencia al endpoint del servidor hecho con express
const URI ='http://localhost:8000/canchas/'

//estas son funciones con el formato de funcion flecha, aunque tambien se puededn declarar con la palabra reservada 'function'
const CompShowCanchas = () => { 
    //configuramos hooks
    const [canchas, setCancha] = useState([])
    useEffect( () => { 
        getCanchas()
    },[])
    //Procedimiento para mostrar todas las canchas
    const getCanchas = async () => {
        const res = await axios.get(URI)
        setCancha(res.data)
    }

    const deleteCancha = async (id) => {
        axios.delete(`${URI}${id}`)
        getCanchas() //para que muestre los resultados despues de la eliminacion
    }
    //retornamos una vista (tabla de bootstrap)
    return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <Link to="/creates" className='btn btn-primary mt-2 mtb-2'>Crear</Link>
                    <thead className='table-primary'>
                        <tr>
                            <th>Nombre del Deportivo</th>
                            <th>Tipo de Cancha</th>
                            <th>Nombre del encargado</th>
                            <th>Teléfono del encargado</th>
                            <th>Puesto del engargado</th>
                            <th>RFC</th>
                            <th>Calle de la cancha</th>
                            <th>Número</th>
                            <th>Colonia</th>
                            <th>Código Postal</th>
                            <th>Alcaldía</th>
                            <th>Entre Calles</th>                            
                            <th>Referencias</th>
                            <th>Condición de la cancha</th>
                            <th>Ubicación</th>
                            <th>Acciones</th>
                        </tr>
                    </thead>
                    <tbody>
                        {canchas.map ((cancha) => (
                            <tr key={cancha.id}>
                                <td> {cancha.deportivoName}</td>
                                <td> {cancha.canchaName}</td>
                                <td> {cancha.encargadoName}</td>
                                <td> {cancha.encargadoPhone}</td>
                                <td> {cancha.encargadoPosition}</td>
                                <td> {cancha.encargadoRFC}</td>
                                <td> {cancha.dirCalle}</td>
                                <td> {cancha.dirNumero}</td>
                                <td> {cancha.dirColonia}</td>
                                <td> {cancha.dirCP}</td>
                                <td> {cancha.dirAlcaldia}</td>
                                <td> {cancha.dirEntreCalles}</td>
                                <td> {cancha.dirReferencias}</td>
                                <td> {cancha.condicion}</td>                                
                                <td> {cancha.coordinates}</td>
                                
                                <td>
                                    <Link to ={`/edit/${cancha.id}`} className='btn btn-info'>Editar</Link>
                                </td>
                                
                                <td><button onClick={() => deleteCancha(cancha.id)} className='btn btn-danger'>Eliminar</button></td>
                            </tr>
                        ))}
                    </tbody>
                </div>
            </div>
        </div>
    )
}

export default CompShowCanchas
